content.css:
.visual-sandbox > iframe {
  display: none;
}
.PowerAppsUi {
  position: absolute;
}
.power-apps-visual,
.power-apps-visual-noconf {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100%;
  flex-direction: column;
  padding: 10%;
  vertical-align: center;
  margin-bottom: 5px;
}
.button .closeButtonIcon {
  position: relative;
  cursor: pointer;
  top: 12px;
  right: 7px;
  width: 15px;
  height: 15px;
  display: inline-block;
  margin-right: 5px;
  background-color: rgba(0, 0, 0, 0);
  background-repeat: no-repeat;
  background-size: 100% 100%;
  background-image: url('data:image/png;base64,');
}
.infoIcon {
  width: 15px;
  height: 15px;
  display: inline-block;
  margin-right: 5px;
  margin-bottom: -2px;
  background-repeat: no-repeat;
  background-size: 100% 100%;
  background-image: url('data:image/png;base64,');
}
.blankImage {
  margin: 0px;
  height: 40%;
  width: 250px;
  margin-top: 10%;
  margin-bottom: 10%;
  align-self: center;
  background-size: 250px 100%;
  background-repeat: no-repeat;
  background-image: url(data:image/png;base64,);
}
.splitter {
  height: 2px;
  background: gray;
  width: 100%;
  font-size: 2px;
  /* IE */
}
.button-skip {
  border: none;
  background: none;
  text-decoration: underline;
  font-family: Arial, Helvetica, sans-serif;
}
p.blankVisualBottomText {
  font-size: 12px;
  font-weight: bold;
  word-wrap: break-word;
  -ms-word-wrap: break-word;
}
.logo {
  background-image: url("data:image/ico;base64,");
  background-repeat: no-repeat;
  background-size: cover;
  border: none;
  width: 30px;
  height: 28px;
  margin-right: 5px;
  float: left;
}
.logoContainer {
  align-items: center;
  align-content: center;
}
.logoText {
  font-size: 20px;
  font-weight: bold;
  float: right;
  padding: 0;
  margin: 0;
}
.logoText em {
  background: yellow;
  padding: 5px;
}
.messageBarwarning {
  background: lemonchiffon;
  opacity: 0.99;
  width: 100%;
  height: 20px;
  vertical-align: middle;
}
.messageBarwarning p {
  font-size: 11px;
  margin: 0px;
  font-style: normal;
  font-weight: unset;
  top: 5px;
}
.messageBarwarning .messageText {
  padding-left: 5px;
  display: block;
  overflow: auto;
}
.messageBar {
  width: 100%;
  min-height: 35px;
  position: absolute;
  z-index: 1;
}
.messageBar > div {
  vertical-align: middle;
  margin-right: 15px;
}
.messageBar a {
  text-decoration: underline;
  margin-left: 5px;
  cursor: pointer;
  white-space: nowrap;
}
.messageBar p {
  font-size: 14px;
  margin: 5px 15px 15px 15px;
  font-style: normal;
  font-weight: unset;
  padding-top: 5px;
  width: 90%;
  cursor: default;
}
.messageBar button {
  padding-top: 3px;
  min-width: 15px;
  display: inline;
  border: none;
  outline: none;
  background: none;
  font-family: monospace;
  z-index: 2;
  font-size: 20px;
}
.messageBar .button {
  height: 0px;
  overflow: visible;
  vertical-align: middle;
  text-align: right;
  margin-right: 0;
}
.messageBarinfo {
  background: lightgray;
  opacity: 0.95;
  overflow: auto;
}
#embed-studio-container {
  width: 100%;
  height: 100%;
  position: absolute;
}
.messageBarPowerBIIntegrationBackground {
  opacity: 0.2;
  background-color: black;
  height: 100%;
  width: 100%;
  position: absolute;
  z-index: 2;
}
.messageBarPowerBIIntegration {
  opacity: 1;
  width: 80%;
  min-height: 110px;
  top: -50px;
  left: 10%;
  float: left;
  position: relative;
  background: white;
  z-index: 3;
  overflow: hidden;
}
.messageBarPowerBIIntegration .messageText {
  margin-left: 15px;
  margin-right: 15px;
}
.messageBarPowerBIIntegration .messageTitle {
  margin-left: 15px;
  margin-right: 15px;
  font-size: 16px;
  font-family: "";
  font-family: "Segoe UI", "Helvetica Neue", Helvetica, Arial, sans-serif;
  font-weight: 500;
}
.messageBarPowerBIIntegration .buttonsBar {
  margin-right: 15px;
  display: flex;
  justify-content: flex-end;
}
.messageBarPowerBIIntegration .buttonsBar button {
  content: center;
  outline: none;
  border: none;
  cursor: pointer;
  opacity: 1;
  flex-grow: 1;
  flex-basis: 150px;
  min-height: 30px;
  min-width: 80px;
  max-width: 150px;
  margin-left: 5px;
  margin-bottom: 15px;
  float: right;
  font-size: 14px;
}
.messageBarPowerBIIntegration .buttonsBar button.add {
  background-color: #702775;
}
.messageBarPowerBIIntegration .buttonsBar button.add span {
  font-family: "Segoe UI", "Helvetica Neue", Helvetica, Arial, sans-serif;
  font-size: 14px;
  color: white;
}
.messageBarPowerBIIntegration .buttonsBar button.ignore {
  background-color: #dcdcdc;
}
.messageBarPowerBIIntegration .buttonsBar button.ignore span {
  font-family: "Segoe UI", "Helvetica Neue", Helvetica, Arial, sans-serif;
  font-size: 14px;
  color: black;
}
